&quot;For those who missed the Coachwhips the first time around, here&amp;#039;s a strident howl from beyond the grave. Double Death, the San Francisco band&amp;#039;s posthumous double release of odds and sods, sounds like the scorched remains of a searing, gung-ho noise-punk career-- in this case, that&amp;#039;s a compliment. Difficult as it is to imagine, these rarities actually further degenerate the band&amp;#039;s already vestigial albeit effective take on punk rock. Some studio scraps, combined with eclectic covers ranging from the Kinks to the Velvet Underground to Adam and the Ants, nicely eulogize a career that burned bright, short, and most importantly, ass-kickingly.

